import style from './Search.module.css'
import { useEffect, useState } from 'react'
import { useLocation } from 'react-router-dom'
import { useNavigate } from 'react-router-dom'

function Search() {
  const [guardian, setGuardian] = useState()
  const [ny, setNy] = useState()
  const [newsApi, setNewsApi] = useState()
  const location = useLocation()
  const nav = useNavigate()
  const [sources, setSource] = useState()
  let currentPage = 2

  const l = location.pathname.split('/')[1]
  const source = location.search.split('=')[1]
  const keyword = l.toLocaleLowerCase()

  // FETCHING THE NEWS
  useEffect(() => {

    //GUARDIAN
    async function newsData1() {
      const GUARDIAN_API = await fetch(`https://content.guardianapis.com/search?page=${currentPage}&${keyword}&api-key=ac83f541-8a6f-49b6-a8fe-7af22e4f4924`)
      const g = await GUARDIAN_API.json()
      const guardianMap = g.response.results.map(ev => (
        <div key={ev.id} className={style.title}>
          <a href={ev.webUrl}>{ev.webTitle}</a>
          <p>{ev.webUrl.split('/')[2]}</p>
        </div>
      ))
      setGuardian(guardianMap)

    }
    // newsData1()

    //NEW YORK TIMES
    async function newsData2() {
      const NY_API = await fetch(`https://api.nytimes.com/svc/search/v2/articlesearch.json?${keyword}?page=${currentPage}&api-key=pFRWaAYSzJcy93VdWbwBz8squ4LkfIeq`)
      const n = await NY_API.json()
      const nyMap = n.response.docs.map(ev => (
        <div key={ev._id} className={style.title}>
          <a href={ev.web_url}>{ev.abstract}</a>
          <p>{ev.web_url.split('/')[2]}</p>
        </div>
      ))
      setNy(nyMap)
    }
    // newsData2()

    // NEWS_API
    async function newsData3() {
      // const NEWSAPI_API = await fetch(`https://newsapi.org/v2/everything?q=a&from=2024-04-26&sortBy=popularity&apiKey=d7116b1cbcfd4fdd9e28ca60ba30ec7c`)
      // const NEWSAPI_API = await fetch(`https://newsapi.org/v2/everything/source=?category=sport&from=2024-04-26&sortBy=popularity&apiKey=d7116b1cbcfd4fdd9e28ca60ba30ec7c`)
      // const NEWSAPI_API = await fetch('https://newsapi.org/v2/top-headlines/sources?category=business?apiKey=d7116b1cbcfd4fdd9e28ca60ba30ec7c')
      const NEWSAPI_API = await fetch('https://newsapi.org/v2/everything?q=apple&from=2024-04-29&to=2024-04-29&sortBy=popularity&apiKey=d7116b1cbcfd4fdd9e28ca60ba30ec7c')
      const na = await NEWSAPI_API.json()
      const newsApiMap = na.articles.map(ev => (
        <div key={Math.random()} className={style.title}>
          <a href={ev.url}>{ev.title}</a>
          <p>{ev.url.split('/')[2]}</p>
        </div>
      ))
      setNewsApi(newsApiMap)


    }
    // newsData3()

  }, [])


  const checkboxHandler = (ev) => {
    setSource(ev.target.value);
    nav(`/${keyword}?source?=${ev.target.value}`)
    // window.location.reload()
  }

  const checkboxChangeHandler = (ev) => {

  }

  return (
    <div className={style.body}>


      <div className={style.filter}>
        <h1>Sourt by</h1>
        <select>
          <option>date</option>
          <option>category</option>
          <option>resourse</option>
        </select>
      </div>


      <div className={style.checkboxBody}>

        <div className={style.checkbox}>
          <input type='checkbox' onChange={checkboxChangeHandler} onClick={checkboxHandler} value={'www.theguardian.com'} />
          <label>www.theguardian.com</label>
        </div>

        <div className={style.checkbox}>
          <input type='checkbox' />
          <label>www.nytimes.com</label>
        </div>

      </div>


      <div>
        {guardian}
      </div>

      <div>
        {ny}
      </div>


      <div style={{border: '15px solid red'}}>
        {newsApi}
      </div>
    </div>
  )
}
export default Search
